import React from "react";

function Dashboard() {
  return (
    <div className="section">
      <h1>Dashboard</h1>
      <div className="dashboard-container">
        <div className="balance">
          <h5>Your Balance</h5>
          <p id="balance-money">$0.00</p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
